import React from 'react';
import styles from './jamming.module.css';

const fetchAccessToken = async () => {
    const clientId = '367a1dd9d8fa4e7aac443fb3cd47e9fd'; // Replace with your Client ID
    const clientSecret = '87d4c1ad132c440383be6992fb365c6c'; // Replace with your Client Secret
    const tokenUrl = 'https://accounts.spotify.com/api/token';

    const response = await fetch(tokenUrl, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/x-www-form-urlencoded',
        'Authorization': 'Basic ' + btoa(clientId + ':' + clientSecret),
      },
      body: new URLSearchParams({
        grant_type: 'client_credentials',
      }),
    });

    const data = await response.json();
    console.log(data.access_token)
    return data.access_token; // Returns the token
  };

  const searchSpotify = async (query ) => {
